import Button from './button';

function Fields(props) {
	console.log(props.data[0].title)
  return (
		<>
			<div>
				<h1>{props.data[0].title}</h1>
				<p>{props.data[0].text}</p>
			</div>
			<Button btnName="Get Started For Free" />
			{
				props.data.slice(1).map(i => {
					return (
							<div>
								<div>
									<h1 key={i}>{i.title}</h1>
									<p key={i+0}>{i.text}</p>
								</div>
								<div>
									<p>{i.number}</p>
								</div>
							</div>
					)
				})
			}
		</>
	)
};

export default Fields;
